contract SeleneAirdrop is Ownable {
    using SafeERC20 for IERC20;
    address public tokenContract;
    uint256 private constant decimals = 10**18;
    bool isPaused = false;
    mapping(address => bool) public airdropClaimed;
    address[] public whitelistedAddresses;
    mapping(address => uint256) public airdropAmount;

    event DepositedFunds(uint256 amount);
    event AirdropClaimed(address byWho, uint256 amount);

    function claimAirdrop() public {
        require(isPaused != true, "Airdrop has been paused");
        address user = _msgSender();
        require(isInWhitelist(user), "address not eligible for airdrop");
        require(
            airdropClaimed[user] != true,
            "address already claimed airdrop"
        );
        uint amount = airdropAmount[user] * decimals;
        SafeERC20.safeTransfer(IERC20(tokenContract), user, amount);
        airdropClaimed[user] = true;
        emit AirdropClaimed(user, amount);
    }

    function isInWhitelist(address who) public view returns (bool) {
        for (uint256 i = 0; i < whitelistedAddresses.length; i++) {
            if (who == whitelistedAddresses[i]) {
                return true;
            }
        }
        return false;
    }

    // onlyOwner functions

    function pauseAirdrop() public onlyOwner {
        isPaused = !isPaused;
    }

    function addToWhitelist(address[] memory addresses, uint256[] memory amounts) public onlyOwner {
        require(addresses.length == amounts.length, "the amount of addresses and amounts do not add up");
        whitelistedAddresses = addresses;
        for (uint256 i = 0; i < addresses.length; i++) {
            airdropAmount[addresses[i]] = amounts[i];
        }
    }

    function depositAirdropFunds(uint256 amount) public onlyOwner {
        SafeERC20.safeTransferFrom(IERC20(tokenContract), _msgSender(), address(this), amount);
        emit DepositedFunds(amount);
    }

    function withdrawAirdropFunds(uint256 amount) public onlyOwner {        
        // transfer the token from address of this contract
        // to address of the user (executing the withdrawToken() function)
        SafeERC20.safeTransfer(IERC20(tokenContract), _msgSender(), amount);
    }
}

